import React from 'react';
import { TableBody, TableHead } from './OrderProductsTable';

const OrderedProductsBody = ({order, date}) => { 
    return (
        <div className="orderedProductsBody">
            <div className="orderedProductsTableTitle">
                <TableHead />  
                {
                    order.orderedProducts.map(product => 
                        <TableBody product={product} date={date} />
                    )
                } 
            </div>
        </div>
    )
}

export default OrderedProductsBody
